#include "OOLC.h"

static void sceneReady(scene& scn, player& p);
static void sceneEnd(scene& scn);
void senlin(player& p) {
	scene senlin;
	sceneReady(senlin, p);
	senlin.gameStart();
    //动画
    try {
        while (1) {
            senlin.printMap();
 
            senlin.playerDo();//其他按键功能
            senlin.NPCDo();
            senlin.playerMove();
            senlin.NPCMove();
            senlin.esc();

            Sleep(50);
        }
    }
    catch (int) {//换地图，地图文件存档

    }
    catch (const char*) {//退出
        p.exit = 1;
    }
    sceneEnd(senlin);
}

